import styled from 'styled-components'

const CardContainer = styled.div`
  width: 300px;
  margin: 1rem;
  border: 1px solid var(--lightgrey);
  border-radius: 1vw;
  background-color: white;
`

const CardImage = styled.img`
width: 100%;
height: 300px;
`

export { CardContainer, CardImage }
